import React from "react";
import Navbar from "../../Navbar";
import DescriptionProfile from "./Descriptions/DescriptionProfile";
import Footer from "../../HomePage/Footer";
import DescriptionCompte from "./Descriptions/DescriptionCompte";

const MonProfil = () => {
  return (
    <>
      <nav>
        <Navbar />
      </nav>
      <div className="flex justify-between mx-[20%] mt-10">
        <h2 className="text-3xl font-semibold text-blue-950">
          Souhaitez vous modifier ces informations ?
        </h2>
        <button
          type="submit"
          className="rounded-md bg-red-400 px-10 py-3 text-sm font-semibold text-white shadow-sm hover:bg-rose-900 hover:scale-105 duration-100 ring-2 ring-red-500 focus-visible:outline focus-visible:outline-2 focus-visible:outline-offset-2 focus-visible:outline-indigo-600"
        >
          <a href="/Authentification">Modifier</a>
        </button>
      </div>
      <DescriptionProfile />

      <div className="flex justify-between mx-[20%] mt-10">
        <h2 className="text-3xl font-semibold text-blue-950">
          Souhaitez vous modifier ces informations ?
        </h2>
        <button
          type="submit"
          className="rounded-md bg-red-400 px-10 py-3 text-sm font-semibold text-white shadow-sm hover:bg-rose-900 hover:scale-105 duration-100 ring-2 ring-red-500 focus-visible:outline focus-visible:outline-2 focus-visible:outline-offset-2 focus-visible:outline-indigo-600"
        >
          <a href="/Authentification">Modifier</a>
        </button>
      </div>
      <DescriptionCompte />
      <Footer />
    </>
  );
};

export default MonProfil;
